// src/index.js
import React from 'react';
import ReactDOM from 'react-dom';
import App from './app.tsx'; // Ensure you have an App component

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
